}

ivec4 convert_position_i(vec4 p1, vec4 s1, vec4 s2, vec4 d2) {
    return convert_position_i(ivec4(p1), ivec4(s1), ivec4(s2), ivec4(d2), 0);
}

vec4 convert_position(vec4 p1, vec4 s1, vec4 s2, vec4 d2, int index_offset) {
    return vec4(convert_position_i(ivec4(p1), ivec4(s1), ivec4(s2), ivec4(d2), index_offset)) + 0.5;
}

vec4 convert_position(vec4 p1, vec4 s1, vec4 s2, vec4 d2) {
    return convert_position(p1, s1, s2, d2, 0);
}


vec2 var2tex(vec2 var_position, vec2 var_stride, vec3 tex_stride, vec3 tex_shape) {
    vec3 tex_pos = convert_position(var_position, var_stride, tex_stride, tex_shape);
    return vec2(tex_pos.y, tex_pos.x);
}
vec2 var2tex(vec3 var_position, vec3 var_stride, vec3 tex_stride, vec3 tex_shape) {
